description:
I want to discuss our fundraising strategy specifically around real estate donations with three primary goals:
1) process of receiving, selling and holding real estate donations;
2) handling transaction fees and appropriate documentation;
3) distribution of funds to non profits, vendors, and our own entity

I would like to speak with a CPA with non profit and real estate expertise

I want to discuss our real estate fundraising strategy with 3 primary goals:
1) process of receiving, selling and holding real estate donations;
2) handling transaction fees, appropriate documentation, and maximizing tax benefit to donors;
3) distribution of funds to non profits, vendors, and our own entity
I prefer to speak with a tax attorney with non profit and real estate expertise.
